import React, { useEffect, useState } from 'react';
import './App.css';

interface User {
  user_id: number,
  username: string,
  email: string,
  sold: number,
}

function getUsers(): User[] {
  const [users, SetUsers] = useState(null);

  useEffect(() => {
    fetch("http://localhost:8080")
      .then((response) => response.json())
      .then((data) => {
        SetUsers(data)
        console.log(data)
      })
      .catch((error) => console.error(error));
  }, []);

  return (
    <div>
      <h1>USers</h1>
      {users &&
        users.map((user) => {return <p>{user.username}</p>})
      }
    </div>
  );
}

function App() {
  const users: User[] = getUsers();
  return (
    <div className="App">
      <ul>
        {users.map((user) => {return <li>{user.username}</li>})}
      </ul>
    </div>
  );
}

export default App;
